import React from "react";
import Header from "./Header/Header";
import Body from "./Body/Body";
import Footer from "./Footer/Footer";
import styled from "styled-components";

const HomeWrapper = styled.div`
  position: absolute;
`;

const Home = () => {
  return (
    <HomeWrapper>
      <Header />
      <Body />
      <Footer />
    </HomeWrapper>
  );
};

export default Home;
